import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const HeroComponent = ({ config, data }) => {
  const [searchQuery, setSearchQuery] = useState('');
  const [isVisible, setIsVisible] = useState(false);
  const [searchFocused, setSearchFocused] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    setIsVisible(true);
  }, []);

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery.trim()) {
      navigate(`/search?q=${encodeURIComponent(searchQuery.trim())}`);
    }
  };

  const title = data?.title || config?.title || 'Welcome to Styli';
  const subtitle = data?.subtitle || config?.subtitle || 'Discover amazing fashion';
  const showSearch = data?.showSearch !== false && config?.showSearch !== false;

  return (
    <section className="hero-section-modern">
      {/* Animated background elements */}
      <div className="hero-bg-animation">
        <div className="floating-shape shape-1"></div>
        <div className="floating-shape shape-2"></div>
        <div className="floating-shape shape-3"></div>
        <div className="floating-shape shape-4"></div>
      </div>

      <div className="container">
        <div className={`hero-content-modern ${isVisible ? 'animate-in' : ''}`}>
          {/* Badge */}
          <div className="hero-badge">
            <span className="badge-text">âœ¨ New Collection</span>
          </div>

          {/* Main title with gradient text */}
          <h1 className="hero-title-modern">
            <span className="title-gradient">{title}</span>
          </h1>

          {/* Subtitle with enhanced styling */}
          <p className="hero-subtitle-modern">
            {subtitle}
          </p>

          {/* Stats section */}
          <div className="hero-stats">
            <div className="stat-item">
              <span className="stat-number">10K+</span>
              <span className="stat-label">Products</span>
            </div>
            <div className="stat-item">
              <span className="stat-number">50+</span>
              <span className="stat-label">Brands</span>
            </div>
            <div className="stat-item">
              <span className="stat-number">24/7</span>
              <span className="stat-label">Support</span>
            </div>
          </div>

          {/* Enhanced search form */}
          {showSearch && (
            <div className={`hero-search-modern ${searchFocused ? 'focused' : ''}`}>
              <form onSubmit={handleSearch} className="search-form">
                <div className="search-input-wrapper">
                  <i className="fas fa-search search-icon"></i>
                  <input
                    type="text"
                    placeholder="Search for products, brands, styles..."
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                    onFocus={() => setSearchFocused(true)}
                    onBlur={() => setSearchFocused(false)}
                    className="search-input"
                  />
                  <button type="submit" className="search-button">
                    <i className="fas fa-arrow-right"></i>
                  </button>
                </div>
              </form>

              {/* Popular searches */}
              <div className="popular-searches">
                <span className="popular-label">Popular:</span>
                <div className="search-tags">
                  <button 
                    type="button" 
                    className="search-tag"
                    onClick={() => navigate('/search?q=summer+dress')}
                  >
                    Summer Dress
                  </button>
                  <button 
                    type="button" 
                    className="search-tag"
                    onClick={() => navigate('/search?q=casual+shoes')}
                  >
                    Casual Shoes
                  </button>
                  <button 
                    type="button" 
                    className="search-tag"
                    onClick={() => navigate('/search?q=accessories')}
                  >
                    Accessories
                  </button>
                </div>
              </div>
            </div>
          )}

          {/* CTA Buttons */}
          <div className="hero-cta">
            <button 
              className="cta-button primary"
              onClick={() => navigate('/products')}
            >
              <span>Shop Now</span>
              <i className="fas fa-arrow-right"></i>
            </button>
            <button 
              className="cta-button secondary"
              onClick={() => navigate('/categories')}
            >
              <span>Browse Categories</span>
              <i className="fas fa-th-large"></i>
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

export default HeroComponent;
